import { Box } from "@mui/system";
import React from "react";
import Content from "./leftContent";

function SideBar() {
  return (
    <div className="Side-nav">
      <Box>
      <h3>Home</h3>
      </Box>
      
        <Content sx={{ marginTop:"20px"}} />
   

    </div>
  );
}

export default SideBar;
